import React from 'react';
import { Grid,Stack,Typography,Box,useTheme} from '@mui/material';
import Tab from "./Tab";
import {DetailsOutlined,InsertDriveFileOutlined,EmailOutlined,PhoneIphoneOutlined,CheckroomOutlined} from "@mui/icons-material"
import "../../Themes/Home.css"

const Home = () => {
    const theme=useTheme();
    theme.typography.h5 = {
        fontSize: '0.8rem',
        [theme.breakpoints.up('sm')]: {
          fontSize: '2rem',
        },
      };
      theme.typography.caption = {
        fontSize: '0.7rem',
        [theme.breakpoints.up('sm')]: {
          fontSize: '1.2rem',
        },
      };

    return (

        <>
           <Grid container  justifyContent="center" alignItems="center" sx={{height:"100%"}}>

       <Grid xs={10} sx={{bgcolor:"#000000",height:"20%",color:"#ffffff",border:2,borderColor:"#ffffff",borderRadius:1,boxShadow:3}}>
     <Stack direction="row" alignItems="center" sx={{height:"100%",p:1}}>
    <img  src="https://friendv.files.wordpress.com/2013/08/monica-geller.jpg" alt="Profile Picture" className="profileImg"/>
    <Box sx={{ml:2}}>
    <Typography variant="h5" sx={{fontWeight:"bold"}}>Monica Geller</Typography>
    <Typography variant="caption">Stylist</Typography>
    </Box>

     </Stack>
       </Grid>
       <Grid md={3} xs={5} sx={{height:"20%"}}>


       <Tab details="Order Details" icon={<DetailsOutlined/>}/>

       </Grid>
       <Grid xs={5} md={3} sx={{height:"20%"}}>

         <Tab details="File Center" icon={<InsertDriveFileOutlined/>}/>
       </Grid>
       <Grid xs={5} md={3} sx={{height:"20%"}}>
       <Tab details="Message Center" icon={<EmailOutlined/>}/>

       </Grid>
       <Grid xs={5} sx={{height:"20%"}}>

     <Tab details="Virtual Appointment" icon={<PhoneIphoneOutlined/>}/>

       </Grid>
       <Grid xs={5} sx={{height:"20%"}}>
       <Tab details="Try on Appointment" icon={<CheckroomOutlined/>}/>


       </Grid>
           </Grid>
        </>
    )
}

export default Home
